INSERT INTO `question` VALUES (1,'<h1>Bestimmte Kompetenzen werden aufgrund der Digitalisierung in 3 Jahren relevanter sein als andere.</h1>\r\n<p>Bitte bewerten Sie dazu die folgenden Aussagen.</p>',2,'question'),(2,'<h1>In bestimmten Bereichen sind die Entwicklungen hauptsächlich dafür ursächlich, dass die relevanten Kompetenzen sich im Digitalen Wandel in den nächsten 3 Jahren ändern.</h1>\r\n<p>Bitte bewerten Sie die folgenden Aussagen.</p>',3,'question'),(3,'Relevante Kompetenzen für den Digitalen Wandel',1,'group'),(4,'<h1>Kompetenzen/Kompetenzfelder müssen im Kontext des Digitalen Wandels neu berücksichtigt oder neu formuliert werden.</h1>\r\n<p>Bitte bewerten Sie dazu folgende Aussagen.</p>',4,'question'),(5,'<h1>Kompetenzen und Kompetenzfelder müssen um Digitalen Wandel neu berücksichtigt werden.</h1><p>Bitte geben Sie mehrfache Antworten durch ein Komma getrennt an. Bspw. Medienkompetenz, Internetkompetenz</p>',5,'question'),(6,'<h1>Kompetenzen, die mit der Durchführung von Operatoren zusammenhängen gewinnen im Kontext des Digitalen Wandels an Bedeutung.</h1><p>Bitte bewerten Sie dazu folgende Aussagen.</p>',6,'question'),(7,'<h1>Bestimmte Kompetenz-Bereiche verlieren im Zuge des Digitalen Wandels an Bedeutung.</h1><p>Bitte bewerten Sie dazu folgenden Aussagen</p>',7,'question'),(8,'<h1>Es gibt Kompetenzbereiche die zukünftig nur noch auf höchstem Niveau Bedeutung erlangen, auf geringem Kompetenzniveau aber an Bedeutung deutlich einbüßen.</h1>\r\n<p>Bitte bewerten Sie dazu folgende Aussagen.</p>',8,'question'),(9,'<h1>Kompetenzen verlieren im Kontext des Digitalen Wandels an Bedeutung.</h1>\r\n<p>Bitte geben Sie mehrfache Antworten durch ein Komma getrennt an. Bspw. Medienkompetenz, Internetkompetenz</p>',9,'question'),(10,'<h1>In bestimmten Gebieten besteht ein besonderer Entwicklungsbedarf, um ein Kompetenzmodell für den Digitalen Wandel zur Verfügung stellen zu können.</h1><p>Bitte bewerten Sie folgende Aussagen.</p>',10,'question'),(11,'<h1>In bestimmten Gebieten besteht ein besonderer Entwicklungsbedarf, um ein Kompetenzmodell für den Digitalen Wandel zur Verfügung stellen zu können.</h1><p>Bitte bewerten Sie folgende Aussagen</p>',11,'question'),(12,'<h1>In welchen Bereichen Können Sie konkrete Arbeiten benennen, die in die Entwicklung eines neuen Kompetenzmodells für den Digitalen Wandel einfließen sollten?</h1>',12,'question'),(13,'<h1>Es sind Entwicklungsarbeiten notwendig, um mit Kompetenzmodellen dem Digitalen Wandel gerecht werden zu können.</h1><p>Bitte bewerten Sie die folgenden Aussagen</p>',13,'question'),(14,'<h1>Können Sie eine konkrete Arbeit benennen, welche ein Kompetenzmodell beinhaltet, dass alle Kompetenzen benennt, die im Digitalen Wandel relevant sind?</h1>',14,'question'),(15,'<h1>Entwicklungen in der Messung von Kompetenzen werden im Digitalen Wandel erwartet.</h1><p>Bitte bewerten Sie folgende Aussagen</p>',15,'question'),(16,'<h1>Es wird auf verschiedenen Ebenen beim Management von Kompetenzen im Digitalen Wandel Veränderungen geben.</h1><p>Bitte bewerten Sie folgende Aussagen</p>',16,'question'),(17,'<h1>Bestimmte Kontexte müssen durch die Entwicklung spezieller Varianten von Kompetenzmodellen für den Digitalen Wandel berücksichtigt werden.</h1><p>Bitte bewerten Sie folgende Aussagen</p>',17,'question');
/*!40000 ALTER TABLE `question` ENABLE KEYS */;
UNLOCK TABLES;
commit;

