INSERT INTO `survey` VALUES (1,'Kompetenzmodelle für den Digitalen Wandel','<h3>Sehr geehrte Teilnehmerin, sehr geehrter Teilnehmer,</h3>\r\n\r\n<p>herzlichen Dank, dass Sie sich an unserer Delphi-Studie zum Thema \"Kompetenzen für den Digitalen Wandel\" beteiligen.</p>','<h3>Herzlichen Dank für Ihre Teilnahme an unserer Befragung.</h3>\r\n\r\n<p>Sie können Ihre Einschätzungen jederzeit nochmals anpassen. Folgen Sie dazu einfach wieder Ihrem individuellen Zugriffslink, den Sie mit Ihrer Einladung erhalten haben.</p>\r\n\r\n<p>Falls Sie Anmerkungen zu unserer Befragung haben, freuen wir uns darüber, wenn Sie uns diese hier hinterlassen, damit wir unser Erhebungsinstrument weiterentwicklen können. Außerdem können Sie uns hier auch informieren, falls Sie die Ergebnisse nicht oder an eine andere Emailadresse zugeschickt bekommen möchten.</p>\r\n\r\n<p>Ihr Real-Time-Delphi-Team</p>');
/*!40000 ALTER TABLE `survey` ENABLE KEYS */;
UNLOCK TABLES;
commit;

